export default class Demo extends React.PureComponent {
	constructor(props) {
		super(props);

		this.state = {
			data,
		};
	}

	render() {
		const { data: chartData } = this.state;

		return (
			<Paper>
				<Chart
					data={chartData}
				>
					<ArgumentScale factory={scaleTime} />
					<ValueScale factory={scaleLog} modifyDomain={modifyDomain} />
					<ArgumentAxis />
					<ValueAxis tickFormat={format} />

